// src/pages/Rush.js

import React, {useEffect, useState} from 'react';
import './Rush.css';
import ZetaClassImage from '../assets/ZetaClass.png'; // Import the background image

const Rush = () => {
    const calculateTimeLeft = () => {
        const targetDate = new Date("2025-01-01T00:00:00");
        const now = new Date();
        const difference = targetDate - now;
        let timeLeft = {};

        if (difference > 0) {
            timeLeft = {
                days: Math.floor(difference / (1000 * 60 * 60 * 24)),
                hours: Math.floor((difference / (1000 * 60 * 60)) % 24),
                minutes: Math.floor((difference / 1000 / 60) % 60),
                seconds: Math.floor((difference / 1000) % 60),
            };
        }
        return timeLeft;
    };

    const [timeLeft, setTimeLeft] = useState(calculateTimeLeft());

    useEffect(() => {
        const timer = setTimeout(() => {
            setTimeLeft(calculateTimeLeft());
        }, 1000);

        return () => clearTimeout(timer);
    }, [timeLeft]);

    return (
        <div className="rush">
            <div className="rush-hero" style={{backgroundImage: `url(${ZetaClassImage})`}}>
                <h1 className="title">WINTER RUSH 2025</h1>
            </div>
            <div className="countdown-section">
                <h2 className="countdown-title">Countdown to Rush</h2>
                <div className="countdown">
                    {Object.keys(timeLeft).length ? (
                        Object.keys(timeLeft).map((interval) => (
                            <div key={interval} className="countdown-element">
                                {timeLeft[interval]} {interval}
                            </div>
                        ))
                    ) : (
                        <span>Time's up!</span>
                    )}
                </div>
            </div>
            <div className="week-calendar">
                {['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'].map((day, index) => (
                    <div key={index} className="day-card">
                        <h3>{day}</h3>
                        <p>Add info here</p>
                    </div>
                ))}
            </div>
            <p>Information about rushing Theta Tau.</p>

            {/* FAQ Section */}
            <div className="faq-section">
                <h2>Frequently Asked Questions</h2>
                <h3>What is Theta Tau?</h3>
                <p>Theta Tau is a co-ed professional engineering fraternity. The purpose of Theta Tau is to develop and maintain a high standard of professional interest among its members, and to unite them in a strong bond of fraternal fellowship. We separate ourselves from being a social fraternity because we encompass a professional, common goal. We are foremost a family of diverse engineering students seeking to improve the world around us.</p>

                <h3>How can I join Theta Tau?</h3>
                <p>Come out to our mixer events throughout fall quarter and rush during Winter 2024! If we find that you are a good fit, you will be extended a bid. Once you accept, you will have to go through the formal 6-week pledging process in order to be an active member.</p>

                <h3>What is Rush?</h3>
                <p>Rush is the 2 week period of events set up in order for us to meet prospective members. Typically, it consists of two information sessions, an engineering-related event, an invite-only event, and a formal invite-only professional interview. You can find the schedule of events for Winter Rush 2024 on this page when we get closer to rush.</p>

                <h3>Why should I join Theta Tau?</h3>
                <p>By joining Theta Tau, you will be able to meet other engineers in different majors and work on yourself professionally, academically and socially!</p>

                <h3>Who can join Theta Tau?</h3>
                <p>Any undergraduate with a major of Engineering (COEN, MECH, ELEN, BIOE, CENG, WDE, Undeclared, etc), Engineering Physics, or Computer Science with a GPA of 2.0 or above is eligible. All genders may apply. We greatly encourage first years, sophomores and juniors to apply. Seniors are also welcome to apply as well on the condition that they are going to be completing a graduate degree at SCU, but just know that if accepted they would potentially spend winter quarter as a pledge and have the same requirements and responsibilities that pledging entails on top of the extra responsibilities seniors have with senior design.</p>

                <h3>What is pledging? How much of a time commitment is the pledging process?</h3>
                <p>If you receive a bid to pledge our fraternity, you will then be involved in a 6-week pledging process in which you learn about our fraternity and participate in a variety of brotherhood, professional, and service events. This typically requires several hours a week for weekly meetings and other pledging requirements, as well as a few hours on weekends for various activities and events. As all of us are engineers, we understand how rigorous engineering can be. If you are concerned about the time commitment, please talk to our pledging instructors, Arran Kooner (akooner@scu.edu) and Julia Cornejo (jcornejo@scu.edu).</p>

                <h3>How much of a time commitment is being an active brother?</h3>
                <p>As an active brother, you are expected to come to weekly chapter meetings and participate in the wide variety of events that we plan, generally weekly.</p>

                <h3>Wait, I have more questions!</h3>
                <p>No problem email (placeholder email) if you have any questions you need answered.</p>
            </div>
        </div>
    );
};

export default Rush;
